import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import DefaultDashboard from './DefaultDashboard';
import WarriorEdge from './WarriorEdge';
import MomentumEdge from './MomentumEdge';
import TrendEdge from './TrendEdge';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<DefaultDashboard />} />
        <Route path="/warrioredge" element={<WarriorEdge />} />
        <Route path="/momentumedge" element={<MomentumEdge />} />
        <Route path="/trendedge" element={<TrendEdge />} />
      </Routes>
    </Router>
  );
};

export default App;
